import axios from 'axios';

const apiEndpoint = 'https://api.nasa.gov/planetary/apod';

axios.get(apiEndpoint, { params: { api_key: '3WrQDqS1rcHbMRg7dhxI8vxxXWNZDmT0AJQkA2h7' } })
  .then(response => {
    console.log(response.data);
  })
  .catch(error => {
    console.error(error);
  });
